import React from "react";
import styled from "styled-components";

const HeaderContainer = styled.header`
  width: 100%;
  height: 100%;
  display: flex;
`;
function Index() {
  return (
    <>
      <HeaderContainer>This is Hearder</HeaderContainer>
    </>
  );
}

export default Index;
